// 15.9public class ImmutableName implements Comparable{	private String first;  // first name	private String last;   // last name	public ImmutableName()	{	} // end default constructor	public ImmutableName(String firstName, String lastName)	{		first = firstName;		last = lastName;	} // end constructor	public String getFirst()	{		return first;	} // end getFirst	public String getLast()	{		return last;	} // end getLast		public int compareTo(Object other)	{		ImmutableName otherName = (ImmutableName)other;				int result = last.compareTo(otherName.last);				if (result == 0)		{ 	// last names are equal, check first name			result = first.compareTo(otherName.first);		} // end if					return result;		} // end compareTo		public String toString()	{		return first + " " + last;	} // end toString	public Name getMutable()	{		return new Name(first, last);	} // end getMutable	protected void setFirst(String firstName)	{		first = firstName; 	} // end setFirst	protected void setLast(String lastName)	{		last = lastName;	} // end setLast	protected void setName(String firstName, String lastName)	{		setFirst(firstName);		setLast(lastName);	} // end setName} // end Name